The longest palindrome subsequence (LPS) problem is a well-known problem in computer science where you have to find the longest subsequence in a given sequence that is a palindrome. 

Here, I will provide a solution using Dynamic Programming approach. 

```python
def lps(seq): 
    n = len(seq) 

    # Create a table to store results of subproblems 
    dp = [[0 for x in range(n+1)] for y in range(n+1)] 

    # Strings of length 0 and 1 are always palindromes
    for i in range(n+1): 
        dp[i][i] = 1

    # Consider all substrings of length 2 
    for cl in range(2, n+1): 
        for i in range(n): 
            j = cl + i - 1
            if j < n:
                if seq[i] == seq[j] and cl == 2:
                    dp[i][j] = 2
                elif seq[i] == seq[j]: 
                    dp[i][j] = dp[i+1][j-1] + 2
                else: 
                    dp[i][j] = max(dp[i][j-1], dp[i+1][j]); 

    return dp[0][n-1]
```

This function takes a string as input and returns the length of the longest palindromic subsequence. The `dp` table is created dynamically where `dp[i][j]` contains the length of the longest palindromic subsequence in `seq[i..j]`. The outer two loops ensure that all substrings are processed. The inner if-else construct is used to update the `dp` table based on the comparisons between `seq` characters, which results in an algorithm with a time complexity of O(N^2) and space complexity of O(N^2). Please note that this solution is case-sensitive, so "a" and "A" are considered different characters.

